},
{
  id: 4,
  title: 'Aprendiendo Algoritmo con Python',
  category: 'Desarrollo y Programación',
  day:'Jueves',
  time: '05/05/2021'
}]

  return (
    <>
     <div className='container'>
      <div className='row justify-content-center'>
      <Header />
      </div>
     </div>
    </>
  )
}


export default App;
